import React, { useState, useEffect } from 'react';
import { Container, Typography, Paper, Box, TextField } from '@mui/material';
import { GET_KAS_PRICE } from './constants/urls';
import DonationWidget from './DonationWidget';
import Chart from './Chart';

// Function to get the current date as a string in YYYY-MM-DD format
const getCurrentDateString = () => {
  const today = new Date();
  const year = today.getFullYear();
  const month = String(today.getMonth() + 1).padStart(2, '0');
  const day = String(today.getDate()).padStart(2, '0');
  return `${year}-${month}-${day}`;
};

const getResistanceLine = (daysSinceGb) => {
  return parseFloat((Math.pow(10, -13.14005841) * Math.pow(daysSinceGb, 4.218461)).toFixed(7));
};

const getFairPrice = (daysSinceGb) => {
  return parseFloat((Math.pow(10, -13.25978043) * Math.pow(daysSinceGb, 4.218461)).toFixed(7));
};

const getSupportPrice = (daysSinceGb) => {
  return parseFloat(Math.pow(10, -13.37950245) * Math.pow(daysSinceGb, 4.218461)).toFixed(7);
};

const calculatePercentDelta = (currentPrice, fairPrice) => {
  return parseFloat((100 * ((currentPrice - fairPrice) / fairPrice)).toFixed(1));
};

function calculateDaysSinceGb(currentDate) {
  // Parse the input date string
  const inputDate = new Date(currentDate);

  // Define the reference date
  const referenceDate = new Date('2021-11-07');

  // Calculate the difference in time (milliseconds)
  const timeDifference = inputDate - referenceDate;

  // Convert the difference from milliseconds to days
  const daysDifference = timeDifference / (1000 * 60 * 60 * 24);

  return Math.round(daysDifference);
}

async function getKasCurrentPrice() {
  try {
    const response = await fetch(GET_KAS_PRICE, { method: 'GET' });
    if (!response.ok) {
      throw new Error(`HTTP error! Status: ${response.status}`);
    }
    const response_json = await response.json();
    return parseFloat(response_json.price).toFixed(3);
  } catch (error) {
    console.error('Error fetching crypto price:', error);
    throw error;
  }
}

function App() {
  document.title = "Kaspa Power Law";
  const currentDate = getCurrentDateString();

  const [currentPrice, setCurrentPrice] = useState(' - ');
  const [percentDelta, setPercentDelta] = useState(' - ');
  const [priceData, setPriceData] = useState({});

  useEffect(() => {
    async function fetchData() {
      const kasPrice = await getKasCurrentPrice();
      setCurrentPrice(kasPrice);
      const currentDate = getCurrentDateString();
      const daysSinceGb = calculateDaysSinceGb(currentDate);
      const fairPrice = getFairPrice(daysSinceGb);
      setPercentDelta(calculatePercentDelta(kasPrice, fairPrice));
    }
    fetchData();
  }, []);

  useEffect(() => {
    fetch('/prices.json')
      .then((response) => response.json())
      .then((data) => {
        const transformedData = data.reduce((acc, item) => {
          const price = parseFloat(parseFloat(item.price.replace('$', '')).toFixed(7));
          acc[item.date] = price;
          return acc;
        }, {});
        setPriceData(transformedData);
      })
      .catch((error) => console.error('Error fetching the prices data:', error));
  }, []);

  return (
    <Container
      maxWidth="sm"
      style={{
        backgroundColor: '#292828',
        padding: '20px',
        borderRadius: '10px',
        color: '#fff',
        marginTop: '20px',
      }}
    >
      <Typography
        variant="h4"
        component="h1"
        gutterBottom
        align="center"
        style={{ color: '#fff', fontWeight: 'bolder' }}
      >
        Kaspa Rainbow Chart
      </Typography>
      <Chart/>
      <Box
        display="flex"
        justifyContent="center"
        alignItems="center"
        marginBottom="20px"
      >
      </Box>
      <Typography variant="body1" component="p" style={{ color: '#fff', marginTop: 20, textAlign: 'center' }}>
        <strong>Want to support this website?</strong>
      </Typography>
      <Typography variant="body2" component="p" style={{ color: '#ccc', marginBottom: 20, textAlign: 'center' }}>
        If you find this website useful, consider donating some Kaspa. It helps me run the website and build more tools like this.
      </Typography>
      <DonationWidget/>
      <Typography variant="body1" component="p" style={{ color: '#fff', marginTop: 40, textAlign: 'center' }}>
        Credit to <a style={{ color: 'white' }} href="https://www.blockchaincenter.net/en/bitcoin-rainbow-chart/">https://www.blockchaincenter.net/en/bitcoin-rainbow-chart/</a> for the inspiration for this site.
      </Typography>
    </Container>
  );
}

export default App;
